import React from "react";
import Navbar from "../Components/Navbar";
import Card from "../Components/Card";
import Wdata from "../Components/WatchData";

function wcard(val) {
  return <Card imgsrc={val.imgsrc} title={val.title} price={val.price} />;
}

const Collections = () => {
  return (
    <>
      <Navbar />
      <h1 className="text-center my-5"> Our Collections </h1>
      <div className="container">
        <div className="row">{Wdata.map(wcard)}</div>
      </div>
    </>
  );
};

export default Collections;
